import Droppable from './Droppable';

function Crown() {
    //const [clockColor,setClockColor] = useState("black");
    // const [deviceGroups, setDevices] = useState();

    const dev = (
        <DeviceGroup/>
    )
    return (
        <div className='relative h-[30rem] mt-10 bg-amber-400'>
            <DndContext>
            <Draggable children={dev}> 
            <Droppable/>
            </Draggable>
            </DndContext>
        </div>
    )
}

export default Crown;
